import React from 'react';
import NavBar from "./navBar";
import './App.css';

function MyButton() {
    const goToHomePage = () => {
        window.location.href = '.'; // Correct the method to navigate to the home page
    };
    return (
        <button onClick={goToHomePage} className="button-class">
            Go to Home
        </button>
    );
}

function App() {
    return (
        <div className="App">
            <title>Learning Square</title>
            <NavBar/>
            <div className="App-header">
            <p>This is a learning page</p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
                <MyButton/>
            </div>
        </div>
    );
}

export default App;
